import { savePDF } from '@progress/kendo-react-pdf';

class DocService {
  createPdf = (html,id) => {
    savePDF(html, { 
      paperSize: 'Letter',
      fileName: 'invoice.pdf',
      margin: 3
    })
  }
}

const Doc = new DocService();
export default Doc;
